import React, { Component } from "react";
import classes from "./table.module.css";
import Content from "../table/content/content";

class Table extends Component {
  state = {
    data: null,
    show: false,
  };
  componentDidMount() {
    console.log("conponet did mount");
  }
  render() {
    let data = null;
    if (this.state.show) {
      const d1 = this.state.data;
      data = d1.map((ele) => <Content key={ele.title} val={ele} />);
    }
    return <div className={classes.main_body}>{data}</div>;
  }
}

export default Table;
